\/wiki\/%D0%96%D1%83%D0%B0%D0%BD_%D0%B4%D0%B0_%D0%9D%D0%BE%D0%B2%D0%B0\" class=\"mw-redirect\" title=\"\u0416\u0443\u0430\u043d \u0434\u0430 \u041d\u043e\u0432\u0430\">\u0416\u0443\u0430\u043d \u0434\u0430 \u041d\u043e\u0432\u0430<\/a>, \u0441\u043e\u0441\u0442\u043e\u044f\u0449\u0438\u0439 \u043d\u0430 \u0441\u043b\u0443\u0436\u0431\u0435 \u0443 \u043f\u043e\u0440\u0442\u0443\u0433\u0430\u043b\u044c\u0446\u0435\u0432, \u043e\u0442\u043a\u0440\u044b\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D1%81%D1%82%D1%80%D0%BE%D0%B2_%D0%A1%D0%B2%D1%8F%D1%82%D0%BE%D0%B9_%D0%95%D0%BB%D0%B5%D0%BD%D1%8B\" title=\"\u041e\u0441\u0442\u0440\u043e\u0432 \u0421\u0432\u044f\u0442\u043e\u0439 \u0415\u043b\u0435\u043d\u044b\">\u043e\u0441\u0442\u0440\u043e\u0432 \u0421\u0432\u044f\u0442\u043e\u0439 \u0415\u043b\u0435\u043d\u044b<\/a> \u0432 \u042e\u0436\u043d\u043e\u0439 \u0410\u0442\u043b\u0430\u043d\u0442\u0438\u043a\u0435, \u0440\u0430\u0441\u043f\u043e\u043b\u043e\u0436\u0435\u043d\u043d\u044b\u0439 \u0432 1950&#160;\u043a\u043c \u043a \u0437\u0430\u043f\u0430\u0434\u0443 \u043e\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D1%84%D1%80%D0%B8%D0%BA%D0%B0\" title=\"\u0410\u0444\u0440\u0438\u043a\u0430\">\u0410\u0444\u0440\u0438\u043a\u0438<\/a> \u0438 \u043f\u043b\u043e\u0449\u0430\u0434\u044c\u044e 122 \u043a\u043c\u00b2.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1635_%D0%B3%D0%BE%D0%B4\" title=\"1635 \u0433\u043e\u0434\">1635<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D1%80%D0%B0%D0%BD%D1%86%D0%B8%D1%8F\" title=\"\u0424\u0440\u0430\u043d\u0446\u0438\u044f\">\u0424\u0440\u0430\u043d\u0446\u0438\u044f<\/a> \u0432\u0441\u0442\u0443\u043f\u0430\u0435\u0442 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D1%80%D0%B8%D0%B4%D1%86%D0%B0%D1%82%D0%B8%D0%BB%D0%B5%D1%82%D0%BD%D1%8F%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0\" title=\"\u0422\u0440\u0438\u0434\u0446\u0430\u0442\u0438\u043b\u0435\u0442\u043d\u044f\u044f \u0432\u043e\u0439\u043d\u0430\">\u0422\u0440\u0438\u0434\u0446\u0430\u0442\u0438\u043b\u0435\u0442\u043d\u044e\u044e \u0432\u043e\u0439\u043d\u0443<\/a> (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/1618_%D0%B3%D0%BE%D0%B4\" title=\"1618 \u0433\u043e\u0434\">1618<\/a>\u2014<a href=\"https:\/\/ru.wikipedia.org\/wiki\/1648_%D0%B3%D0%BE%D0%B4\" title=\"1648 \u0433\u043e\u0434\">1648<\/a>).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1662_%D0%B3%D0%BE%D0%B4\" title=\"1662 \u0433\u043e\u0434\">1662<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D1%80%D0%BB_II_(%D0%BA%D0%BE%D1%80%D0%BE%D0%BB%D1%8C_%D0%90%D0%BD%D0%B3%D0%BB%D0%B8%D0%B8)\" title=\"\u041a\u0430\u0440\u043b II (\u043a\u043e\u0440\u043e\u043b\u044c \u0410\u043d\u0433\u043b\u0438\u0438)\">\u041a\u0430\u0440\u043b II<\/a>, \u0430\u043d\u0433\u043b\u0438\u0439\u0441\u043a\u0438\u0439 \u043a\u043e\u0440\u043e\u043b\u044c \u0432\u0441\u0442\u0443\u043f\u0430\u0435\u0442 \u0432 \u0431\u0440\u0430\u043a \u0441 \u043f\u043e\u0440\u0442\u0443\u0433\u0430\u043b\u044c\u0441\u043a\u043e\u0439 \u043f\u0440\u0438\u043d\u0446\u0435\u0441\u0441\u043e\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%95%D0%BA%D0%B0%D1%82%D0%B5%D1%80%D0%B8%D0%BD%D0%B0_%D0%91%D1%80%D0%B0%D0%B3%D0%B0%D0%BD%D1%81%D1%81%D0%BA%D0%B0%D1%8F\" title=\"\u0415\u043a\u0430\u0442\u0435\u0440\u0438\u043d\u0430 \u0411\u0440\u0430\u0433\u0430\u043d\u0441\u0441\u043a\u0430\u044f\">\u041a\u0430\u0442\u0430\u0440\u0438\u043d\u043e\u0439 \u0411\u0440\u0430\u0433\u0430\u043d\u0441\u0430<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1674_%D0%B3%D0%BE%D0%B4\" title=\"1674 \u0433\u043e\u0434\">1674<\/a>&#160;\u2014 \u041f\u0440\u0438 \u043f\u043e\u0434\u0434\u0435\u0440\u0436\u043a\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D1%80%D0%B0%D0%BD%D1%86%D0%B8%D1%8F\" title=\"\u0424\u0440\u0430\u043d\u0446\u0438\u044f\">\u0424\u0440\u0430\u043d\u0446\u0438\u0438<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AF%D0%BD_III_%D0%A1%D0%BE%D0%B1%D0%B5%D1%81%D0%BA%D0%B8%D0%B9\" title=\"\u042f\u043d III \u0421\u043e\u0431\u0435\u0441\u043a\u0438\u0439\">\u042f\u043d III \u0421\u043e\u0431\u0435\u0441\u043a\u0438\u0439<\/a> \u0438\u0437\u0431\u0440\u0430\u043d \u043a\u043e\u0440\u043e\u043b\u0451\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B5%D1%87%D1%8C_%D0%9F%D0%BE%D1%81%D0%BF%D0%BE%D0%BB%D0%B8%D1%82%D0%B0%D1%8F\" title=\"\u0420\u0435\u0447\u044c \u041f\u043e\u0441\u043f\u043e\u043b\u0438\u0442\u0430\u044f\">\u0420\u0435\u0447\u0438 \u041f\u043e\u0441\u043f\u043e\u043b\u0438\u0442\u043e\u0439<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1712_%D0%B3%D0%BE%D0%B4\" title=\"1712 \u0433\u043e\u0434\">1712<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%91%D1%82%D1%80_I\" title=\"\u041f\u0451\u0442\u0440 I\">\u041f\u0451\u0442\u0440 I<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B5%D1%80%D0%B5%D0%BD%D0%BE%D1%81_%D1%81%D1%82%D0%BE%D0%BB%D0%B8%D1%86%D1%8B_%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D0%B8_%D0%B8%D0%B7_%D0%9C%D0%BE%D1%81%D0%BA%D0%B2%D1%8B_%D0%B2_%D0%A1%D0%B0%D0%BD%D0%BA%D1%82-%D0%9F%D0%B5%D1%82%D0%B5%D1%80%D0%B1%D1%83%D1%80%D0%B3\" title=\"\u041f\u0435\u0440\u0435\u043d\u043e\u0441 \u0441\u0442\u043e\u043b\u0438\u0446\u044b \u0420\u043e\u0441\u0441\u0438\u0438 \u0438\u0437 \u041c\u043e\u0441\u043a\u0432\u044b \u0432 \u0421\u0430\u043d\u043a\u0442-\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\">\u043f\u0435\u0440\u0435\u043d\u0451\u0441 \u0441\u0442\u043e\u043b\u0438\u0446\u0443<\/a> \u0420\u043e\u0441\u0441\u0438\u0438 \u0438\u0437 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D1%81%D0%BA%D0%B2%D0%B0\" title=\"\u041c\u043e\u0441\u043a\u0432\u0430\">\u041c\u043e\u0441\u043a\u0432\u044b<\/a> \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D0%BD%D0%BA%D1%82-%D0%9F%D0%B5%D1%82%D0%B5%D1%80%D0%B1%D1%83%D1%80%D0%B3\" title=\"\u0421\u0430\u043d\u043a\u0442-\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\">\u0421\u0430\u043d\u043a\u0442-\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1731_%D0%B3%D0%BE%D0%B4\" title=\"1731 \u0433\u043e\u0434\">1731<\/a>&#160;\u2014 \u0434\u043b\u044f \u043e\u0445\u0440\u0430\u043d\u044b \u043f\u043e\u0431\u0435\u0440\u0435\u0436\u0438\u0439 \u0438 \u043e\u0441\u0442\u0440\u043e\u0432\u043e\u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%B8%D1%85%D0%B8%D0%B9_%D0%BE%D0%BA%D0%B5%D0%B0%D0%BD\" title=\"\u0422\u0438\u0445\u0438\u0439 \u043e\u043a\u0435\u0430\u043d\">\u0422\u0438\u0445\u043e\u0433\u043e \u043e\u043a\u0435\u0430\u043d\u0430<\/a>, \u043e\u0442\u043a\u0440\u044b\u0442\u044b\u0445 \u0440\u0443\u0441\u0441\u043a\u0438\u043c\u0438 \u0437\u0435\u043c\u043b\u0435\u043f\u0440\u043e\u0445\u043e\u0434\u0446\u0430\u043c\u0438 \u0438 \u043c\u043e\u0440\u0435\u043f\u043b\u0430\u0432\u0430\u0442\u0435\u043b\u044f\u043c\u0438, \u0441\u043e\u0437\u0434\u0430\u043d\u0430 \u0421\u0438\u0431\u0438\u0440\u0441\u043a\u0430\u044f \u0432\u043e\u0435\u043d\u043d\u0430\u044f \u0444\u043b\u043e\u0442\u0438\u043b\u0438\u044f \u0441 \u0433\u043b\u0430\u0432\u043d\u043e\u0439 \u0431\u0430\u0437\u043e\u0439 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D1%85%D0%BE%D1%82%D1%81%D0%BA\" title=\"\u041e\u0445\u043e\u0442\u0441\u043a\">\u041e\u0445\u043e\u0442\u0441\u043a\u0435<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1765_%D0%B3%D0%BE%D0%B4\" title=\"1765 \u0433\u043e\u0434\">1765 \u0433\u043e\u0434<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B8%D0%BD%D0%B4%D0%B7%D0%BE%D1%80\" title=\"\u0412\u0438\u043d\u0434\u0437\u043e\u0440\">\u0412\u0438\u043d\u0434\u0437\u043e\u0440\u0435<\/a> (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%BE%D0%B2%D0%B0%D1%8F_%D0%A8%D0%BE%D1%82%D0%BB%D0%B0%D0%BD%D0%B4%D0%B8%D1%8F\" title=\"\u041d\u043e\u0432\u0430\u044f \u0428\u043e\u0442\u043b\u0430\u043d\u0434\u0438\u044f\">\u041d\u043e\u0432\u0430\u044f \u0428\u043e\u0442\u043b\u0430\u043d\u0434\u0438\u044f<\/a>) \u043e\u0442\u043a\u0440\u044b\u0442\u0430 \u043f\u0435\u0440\u0432\u0430\u044f \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D0%BD%D0%B0%D0%B4%D0%B0\" title=\"\u041a\u0430\u043d\u0430\u0434\u0430\">\u041a\u0430\u043d\u0430\u0434\u0435<\/a> \u0441\u0435\u043b\u044c\u0441\u043a\u043e\u0445\u043e\u0437\u044f\u0439\u0441\u0442\u0432\u0435\u043d\u043d\u0430\u044f \u0432\u044b\u0441\u0442\u0430\u0432\u043a\u0430.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1792_%D0%B3%D0%BE%D0%B4\" title=\"1792 \u0433\u043e\u0434\">1792<\/a>&#160;\u2014 \u043f\u0440\u043e\u0438\u0437\u043e\u0448\u043b\u043e <a class=\"external text\" href=\"https:\/\/en.wikipedia.org\/wiki\/1792_Unzen_earthquake_and_tsunami\">\u0438\u0437\u0432\u0435\u0440\u0436\u0435\u043d\u0438\u0435<\/a> \u0432\u0443\u043b\u043a\u0430\u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A3%D0%BD%D0%B4%D0%B7%D1%8D%D0%BD_(%D0%B2%D1%83%D0%BB%D0%BA%D0%B0%D0%BD)\" title=\"\u0423\u043d\u0434\u0437\u044d\u043d (\u0432\u0443\u043b\u043a\u0430\u043d)\">\u0423\u043d\u0434\u0437\u044d\u043d<\/a>. \u0412\u0445\u043e\u0434\u0438\u0442 \u0432 \u043f\u044f\u0442\u0435\u0440\u043a\u0443 \u0441\u0430\u043c\u044b\u0445 \u0440\u0430\u0437\u0440\u0443\u0448\u0438\u0442\u0435\u043b\u044c\u043d\u044b\u0445 \u0438\u0437\u0432\u0435\u0440\u0436\u0435\u043d\u0438\u0439 \u0432 \u0438\u0441\u0442\u043e\u0440\u0438\u0438 \u0447\u0435\u043b\u043e\u0432\u0435\u0447\u0435\u0441\u0442\u0432\u0430 \u043f\u043e \u043a\u043e\u043b\u0438\u0447\u0435\u0441\u0442\u0432\u0443 \u0447\u0435\u043b\u043e\u0432\u0435\u0447\u0435\u0441\u043a\u0438\u0445 \u0436\u0435\u0440\u0442\u0432&#160;\u2014 15.000 \u0447\u0435\u043b\u043e\u0432\u0435\u043a.<\/li><\/ul><h3>XIX \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1804_%D0%B3%D0%BE%D0%B4\" title=\"1804 \u0433\u043e\u0434\">1804<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B0%D1%80%D0%B8%D0%B6\" title=\"\u041f\u0430\u0440\u0438\u0436\">\u041f\u0430\u0440\u0438\u0436\u0435<\/a> \u043e\u0442\u043a\u0440\u044b\u043b\u043e\u0441\u044c \u043a\u043b\u0430\u0434\u0431\u0438\u0449\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B5%D1%80-%D0%9B%D0%B0%D1%88%D0%B5%D0%B7\" title=\"\u041f\u0435\u0440-\u041b\u0430\u0448\u0435\u0437\">\u041f\u0435\u0440-\u041b\u0430\u0448\u0435\u0437<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1809_%D0%B3%D0%BE%D0%B4\" title=\"1809 \u0433\u043e\u0434\">1809<\/a>&#160;\u2014 \u0432 \u0445\u043e\u0434\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%BE%D0%B9%D0%BD%D0%B0_%D0%BF%D1%8F%D1%82%D0%BE%D0%B9_%D0%BA%D0%BE%D0%B0%D0%BB%D0%B8%D1%86%D0%B8%D0%B8\" title=\"\u0412\u043e\u0439\u043d\u0430 \u043f\u044f\u0442\u043e\u0439 \u043a\u043e\u0430\u043b\u0438\u0446\u0438\u0438\">\u0412\u043e\u0439\u043d\u044b \u043f\u044f\u0442\u043e\u0439 \u043a\u043e\u0430\u043b\u0438\u0446\u0438\u0438<\/a> \u043f\u0440\u043e\u0438\u0437\u043e\u0448\u043b\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D1%81%D0%BF%D0%B5%D1%80%D0%BD-%D0%AD%D1%81%D1%81%D0%BB%D0%B8%D0%BD%D0%B3%D1%81%D0%BA%D0%B0%D1%8F_%D0%B1%D0%B8%D1%82%D0%B2%D0%B0\" title=\"\u0410\u0441\u043f\u0435\u0440\u043d-\u042d\u0441\u0441\u043b\u0438\u043d\u0433\u0441\u043a\u0430\u044f \u0431\u0438\u0442\u0432\u0430\">\u0410\u0441\u043f\u0435\u0440\u043d-\u042d\u0441\u0441\u043b\u0438\u043d\u0433\u0441\u043a\u0430\u044f \u0431\u0438\u0442\u0432\u0430<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1813_%D0%B3%D0%BE%D0%B4\" title=\"1813 \u0433\u043e\u0434\">1813<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D1%80%D0%B0%D0%B6%D0%B5%D0%BD%D0%B8%D0%B5_%D0%BF%D1%80%D0%B8_%D0%91%D0%B0%D1%83%D1%86%D0%B5%D0%BD%D0%B5\" title=\"\u0421\u0440\u0430\u0436\u0435\u043d\u0438\u0435 \u043f\u0440\u0438 \u0411\u0430\u0443\u0446\u0435\u043d\u0435\">\u0441\u0440\u0430\u0436\u0435\u043d\u04