i\/1944_%D0%B3%D0%BE%D0%B4\" title=\"1944 \u0433\u043e\u0434\">1944<\/a>&#160;\u2014 \u043d\u0430 \u043f\u043b\u0435\u0431\u0438\u0441\u0446\u0438\u0442\u0435 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D1%81%D0%BB%D0%B0%D0%BD%D0%B4%D0%B8%D1%8F\" title=\"\u0418\u0441\u043b\u0430\u043d\u0434\u0438\u044f\">\u0418\u0441\u043b\u0430\u043d\u0434\u0438\u0438<\/a> \u0436\u0438\u0442\u0435\u043b\u0438 \u043f\u043e\u0434\u0434\u0435\u0440\u0436\u0430\u043b\u0438 \u0440\u0435\u0448\u0435\u043d\u0438\u0435 \u043f\u0430\u0440\u043b\u0430\u043c\u0435\u043d\u0442\u0430 \u043e\u0431 \u043e\u0442\u0434\u0435\u043b\u0435\u043d\u0438\u0438 \u043e\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0414\u0430\u043d\u0438\u044f\">\u0414\u0430\u043d\u0438\u0438<\/a>, 17 \u0438\u044e\u043d\u044f \u0431\u044b\u043b\u0430 \u043f\u0440\u043e\u0432\u043e\u0437\u0433\u043b\u0430\u0448\u0435\u043d\u0430 \u0440\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0430.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1945_%D0%B3%D0%BE%D0%B4\" title=\"1945 \u0433\u043e\u0434\">1945<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B8%D1%80%D0%B8%D1%8F\" title=\"\u0421\u0438\u0440\u0438\u044f\">\u0421\u0438\u0440\u0438\u044f<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B8%D0%B2%D0%B0%D0%BD\" title=\"\u041b\u0438\u0432\u0430\u043d\">\u041b\u0438\u0432\u0430\u043d<\/a> \u043f\u0440\u043e\u0432\u043e\u0437\u0433\u043b\u0430\u0441\u0438\u043b\u0438 \u0441\u0432\u043e\u044e \u043d\u0435\u0437\u0430\u0432\u0438\u0441\u0438\u043c\u043e\u0441\u0442\u044c \u043e\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D1%80%D0%B0%D0%BD%D1%86%D0%B8%D1%8F\" title=\"\u0424\u0440\u0430\u043d\u0446\u0438\u044f\">\u0424\u0440\u0430\u043d\u0446\u0438\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1946_%D0%B3%D0%BE%D0%B4\" title=\"1946 \u0433\u043e\u0434\">1946<\/a>&#160;\u2014 \u0437\u0430\u043a\u04