BB%D1%8C%D1%88%D0%B0\" title=\"\u041f\u043e\u043b\u044c\u0448\u0430\">\u041f\u043e\u043b\u044c\u0448\u0430<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D1%8E%D0%B7_%D0%A1%D0%BE%D0%B2%D0%B5%D1%82%D1%81%D0%BA%D0%B8%D1%85_%D0%A1%D0%BE%D1%86%D0%B8%D0%B0%D0%BB%D0%B8%D1%81%D1%82%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B8%D1%85_%D0%A0%D0%B5%D1%81%D0%BF%D1%83%D0%B1%D0%BB%D0%B8%D0%BA\" title=\"\u0421\u043e\u044e\u0437 \u0421\u043e\u0432\u0435\u0442\u0441\u043a\u0438\u0445 \u0421\u043e\u0446\u0438\u0430\u043b\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043a\u0438\u0445 \u0420\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\">\u0421\u0421\u0421\u0420<\/a>).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1965_%D0%B3%D0%BE%D0%B4\" title=\"1965 \u0433\u043e\u0434\">1965<\/a>&#160;\u2014 \u043f\u0440\u0438\u043d\u044f\u0442 \u0444\u043b\u0430\u0433 \u043a\u0430\u043d\u0430\u0434\u0441\u043a\u043e\u0439 \u043f\u0440\u043e\u0432\u0438\u043d\u0446\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D0%BD%D1%82%D0%B0%D1%80%D0%B8%D0%BE\" title=\"\u041e\u043d\u0442\u0430\u0440\u0438\u043e\">\u041e\u043d\u0442\u0430\u0440\u0438\u043e<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1968_%D0%B3%D0%BE%D0%B4\" title=\"1968 \u0433\u043e\u0434\">1968<\/a>&#160;\u2014 \u0432\u044b\u0448\u0435\u043b \u043d\u0430 \u044d\u043a\u0440\u0430\u043d\u044b \u0444\u0438\u043b\u044c\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B0%D1%82%D0%B0%D0%BD%D1%81%D0%BE%D0%BD,_%D0%93%D0%B5%D0%BE%D1%80%D0%B3%D0%B8%D0%B9_%D0%93%D1%80%D0%B8%D0%B3%D0%BE%D1%80%D1%8C%D0%B5%D0%B2%D0%B8%D1%87\" title=\"\u041d\u0430\u0442\u0430\u043d\u0441\u043e\u043d, \u0413\u0435\u043e\u0440\u0433\u0438\u0439 \u0413\u0440\u0438\u0433\u043e\u0440\u044c\u0435\u0432\u0438\u0447\">\u0413\u0435\u043e\u0440\u0433\u0438\u044f \u041d\u0430\u0442\u0430\u043d\u0441\u043e\u043d\u0430<\/a> \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%95%D1%89%D1%91_%D1%80%D0%B0%D0%B7_%D0%BF%D1%80%D0%BE_%D0%BB%D1%8E%D0%B1%D0%BE%D0%B2%D1%8C\" title=\"\u0415\u0449\u0451 \u0440\u0430\u0437 \u043f\u0440\u043e \u043b\u044e\u0431\u043e\u0432\u044c\">\u0415\u0449\u0451 \u0440\u0430\u0437 \u043f\u0440\u043e \u043b\u044e\u0431\u043e\u0432\u044c<\/a>\u00bb, \u0432 \u043a\u043e\u0442\u043e\u0440\u043e\u043c \u0438\u0433\u0440\u0430\u043b\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%BE%D1%80%D0%BE%D0%BD%D0%B8%D0%BD%D0%B0,_%D0%A2%D0%B0%D1%82%D1%8C%D1%8F%D0%BD%D0%B0_%D0%92%D0%B0%D1%81%D0%B8%D0%BB%D1%8C%D0%B5%D0%B2%D0%BD%D0%B0\" title=\"\u0414\u043e\u0440\u043e\u043d\u0438\u043d\u0430, \u0422\u0430\u0442\u044c\u044f\u043d\u0430 \u0412\u0430\u0441\u0438\u043b\u044c\u0435\u0432\u043d\u0430\">\u0422\u0430\u0442\u044c\u044f\u043d\u0430 \u0414\u043e\u0440\u043e\u043d\u0438\u043d\u0430<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B0%D0%B7%D0%B0%D1%80%D0%B5%D0%B2,_%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80_%D0%A1%D0%B5%D1%80%D0%B3%D0%B5%D0%B5%D0%B2%D0%B8%D1%87\" title=\"\u041b\u0430\u0437\u0430\u0440\u0435\u0432, \u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440 \u0421\u0435\u0440\u0433\u0435\u0435\u0432\u0438\u0447\">\u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440 \u041b\u0430\u0437\u0430\u0440\u0435\u0432<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%95%D1%84%D1%80%D0%B5%D0%BC%D0%BE%D0%B2,_%D0%9E%D0%BB%D0%B5%D0%B3_%D0%9D%D0%B8%D0%BA%D0%BE%D0%BB%D0%B0%D0%B5%D0%B2%D0%B8%D1%87\" title=\"\u0415\u0444\u0440\u0435\u043c\u043e\u0432, \u041e\u043b\u0435\u0433 \u041d\u0438\u043a\u043e\u043b\u0430\u0435\u0432\u0438\u0447\">\u041e\u043b\u0435\u0433 \u0415\u0444\u0440\u0435\u043c\u043e\u0432<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1969_%D0%B3%D0%BE%D0%B4\" title=\"1969 \u0433\u043e\u0434\">1969<\/a>&#160;\u2014 \u043f\u0435\u0440\u0432\u044b\u0439 \u043f\u043e\u043b\u0451\u0442 \u0442\u0440\u0430\u043d\u0441\u043f\u043e\u0440\u0442\u043d\u043e\u0433\u043e \u0441\u0430\u043c\u043e\u043b\u0451\u0442\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BD-26\" title=\"\u0410\u043d-26\">\u0410\u043d-26<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1977_%D0%B3%D0%BE%D0%B4\" title=\"1977 \u0433\u043e\u0434\">1977<\/a>&#160;\u2014 \u0437\u0430\u0432\u0435\u0440\u0448\u0435\u043d\u044b \u0441\u044a\u0451\u043c\u043a\u0438 \u0444\u0438\u043b\u044c\u043c\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D0%BF%D0%BF%D0%BE%D0%BB%D0%B0,_%D0%A4%D1%80%D1%8D%D0%BD%D1%81%D0%B8%D1%81_%D0%A4%D0%BE%D1%80%D0%B4\" title=\"\u041a\u043e\u043f\u043f\u043e\u043b\u0430, \u0424\u0440\u044d\u043d\u0441\u0438\u0441 \u0424\u043e\u0440\u0434\">\u0424\u0440\u044d\u043d\u0441\u0438\u0441\u0430 \u0424\u043e\u0440\u0434\u0430 \u041a\u043e\u043f\u043f\u043e\u043b\u044b<\/a> \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BF%D0%BE%D0%BA%D0%B0%D0%BB%D0%B8%D0%BF%D1%81%D0%B8%D1%81_%D1%81%D0%B5%D0%B3%D0%BE%D0%B4%D0%BD%D1%8F\" title=\"\u0410\u043f\u043e\u043a\u0430\u043b\u0438\u043f\u0441\u0438\u0441 \u0441\u0435\u0433\u043e\u0434\u043d\u044f\">\u0410\u043f\u043e\u043a\u0430\u043b\u0438\u043f\u0441\u0438\u0441 \u0441\u0435\u0433\u043e\u0434\u043d\u044f<\/a>\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1979_%D0%B3%D0%BE%D0%B4\" title=\"1979 \u0433\u043e\u0434\">1979<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B6%D0%BE%D0%BD,_%D0%AD%D0%BB%D1%82%D0%BE%D0%BD\" title=\"\u0414\u0436\u043e\u043d, \u042d\u043b\u0442\u043e\u043d\">\u042d\u043b\u0442\u043e\u043d \u0414\u0436\u043e\u043d<\/a> \u0434\u0430\u043b \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D0%BD%D0%BA%D1%82-%D0%9F%D0%B5%D1%82%D0%B5%D1%80%D0%B1%D1%83%D1%80%D0%B3\" title=\"\u0421\u0430\u043d\u043a\u0442-\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\">\u041b\u0435\u043d\u0438\u043d\u0433\u0440\u0430\u0434\u0435<\/a> \u043f\u0435\u0440\u0432\u044b\u0439 \u0438\u0437 \u0432\u043e\u0441\u044c\u043c\u0438 \u043a\u043e\u043d\u0446\u0435\u0440\u0442\u043