u0449\u0430\u0434\u044c \u043c\u0435\u0436\u0434\u0443 \u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u043e\u0439 \u0430\u043a\u0430\u0434\u0435\u043c\u0438\u0435\u0439 \u043d\u0430\u0443\u043a \u0438 \u0421\u0430\u043d\u043a\u0442-\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\u0441\u043a\u0438\u043c \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u043c \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442\u043e\u043c \u043d\u0430\u0437\u0432\u0430\u043d\u0430 \u043f\u043b\u043e\u0449\u0430\u0434\u044c\u044e \u0410\u043a\u0430\u0434\u0435\u043c\u0438\u043a\u0430 \u0421\u0430\u0445\u0430\u0440\u043e\u0432\u0430 \u0432 \u0447\u0435\u0441\u0442\u044c 75-\u0439 \u0433\u043e\u0434\u043e\u0432\u0449\u0438\u043d\u044b \u0441\u043e \u0434\u043d\u044f \u0435\u0433\u043e \u0440\u043e\u0436\u0434\u0435\u043d\u0438\u044f.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1997_%D0%B3%D0%BE%D0%B4\" title=\"1997 \u0433\u043e\u0434\">1997<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B0%D1%88%D0%B8%D0%BD%D0%B3%D1%82%D0%BE%D0%BD_(%D0%BE%D0%BA%D1%80%D1%83%D0%B3_%D0%9A%D0%BE%D0%BB%D1%83%D0%BC%D0%B1%D0%B8%D1%8F)\" class=\"mw-redirect\" title=\"\u0412\u0430\u0448\u0438\u043d\u0433\u0442\u043e\u043d (\u043e\u043a\u0440\u0443\u0433 \u041a\u043e\u043b\u0443\u043c\u0431\u0438\u044f)\">\u0412\u0430\u0448\u0438\u043d\u0433\u0442\u043e\u043d\u0435<\/a> \u0430\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u0430\u044f \u043a\u043e\u043c\u043f\u0430\u043d\u0438\u044f \u00abMattel\u00bb, \u043f\u0440\u043e\u0434\u0430\u044e\u0449\u0430\u044f \u043f\u043e \u0432\u0441\u0435\u043c\u0443 \u043c\u0438\u0440\u0443 \u043c\u0438\u043b\u043b\u0438\u043e\u043d\u044b \u043a\u0443\u043a\u043e\u043b \u0411\u0430\u0440\u0431\u0438, \u043f\u0440\u043e\u0432\u0435\u043b\u0430 \u043f\u0440\u0435\u0437\u0435\u043d\u0442\u0430\u0446\u0438\u044e \u0441\u0432\u043e\u0435\u0433\u043e \u043d\u043e\u0432\u043e\u0433\u043e \u0438\u0437\u0434\u0435\u043b\u0438\u044f&#160;\u2014 \u043a\u0443\u043a\u043b\u044b \u0411\u044d\u043a\u043a\u0438, \u00ab\u043f\u043e\u043b\u0438\u0442\u043a\u043e\u0440\u0440\u0435\u043a\u0442\u043d\u043e\u00bb \u0438\u043c\u0435\u043d\u0443\u0435\u043c\u043e\u0439 \u00ab\u0447\u0430\u0441\u0442\u0438\u0447\u043d\u043e \u043d\u0435\u0442\u0440\u0443\u0434\u043e\u0441\u043f\u043e\u0441\u043e\u0431\u043d\u043e\u0439 \u043f\u043e\u0434\u0440\u0443\u0436\u043a\u043e\u0439 \u0411\u0430\u0440\u0431\u0438\u00bb. \u041f\u043e\u0434\u0440\u0443\u0436\u043a\u0430-\u043a\u0430\u043b\u0435\u043a\u0430 \u043f\u0440\u043e\u0434\u0430\u0451\u0442\u0441\u044f \u0432 \u043a\u043e\u043c\u043f\u043b\u0435\u043a\u0442\u0435 \u0441 \u0438\u043d\u0432\u0430\u043b\u0438\u0434\u043d\u043e\u0439 \u043a\u043e\u043b\u044f\u0441\u043a\u043e\u0439 \u0442\u0440\u0430\u0434\u0438\u0446\u0438\u043e\u043d\u043d\u043e\u0433\u043e \u0434\u043b\u044f \u0438\u0437\u0434\u0435\u043b\u0438\u0439 \u00abMatell\u00bb \u0440\u043e\u0437\u043e\u0432\u043e\u0433\u043e \u0446\u0432\u0435\u0442\u0430.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/2000_%D0%B3%D0%BE%D0%B4\" title=\"2000 \u0433\u043e\u0434\">2000<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A8%D0%B2%D0%B5%D0%B9%D1%86%D0%B0%D1%80%D0%B8%D1%8F\" title=\"\u0428\u0432\u0435\u0439\u0446\u0430\u0440\u0438\u044f\">\u0428\u0432\u0435\u0439\u0446\u0430\u0440\u0438\u0438<\/a> \u043d\u0430 \u0440\u0435\u0444\u0435\u0440\u0435\u043d\u0434\u0443\u043c\u0435 \u0431\u043e\u043b\u044c\u0448\u0438\u043d\u0441\u0442\u0432\u043e \u0436\u0438\u0442\u0435\u043b\u0435\u0439 \u043f\u0440\u043e\u0433\u043e\u043b\u043e\u0441\u043e\u0432\u0430\u043b\u0438 \u0437\u0430 \u0440\u0430\u0441\u0448\u0438\u0440\u0435\u043d\u0438\u0435 \u043e\u0442\u043d\u043e\u0448\u0435\u043d\u0438\u0439 \u0441 \u0415\u0432\u0440\u043e\u043f\u0435\u0439\u0441\u043a\u0438\u043c \u0441\u043e\u044e\u0437\u043e\u043c.<\/li><\/ul><h3>XXI \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/2001_%D0%B3%D0%BE%D0%B4\" title=\"2001 \u0433\u043e\u0434\">2001<\/a>&#160;\u2014 \u043a\u0440\u0443\u043f\u043d\u0435\u0439\u0448\u0438\u0435 \u0430\u0432\u0442\u043e\u043f\u0440\u043e\u0438\u0437\u0432\u043e\u0434\u0438\u0442\u0435\u043b\u0438 \u043f\u043e\u0434\u043f\u0438\u0441\u0430\u043b\u0438 \u0434\u043e\u0433\u043e\u0432\u043e\u0440 \u043e\u0431 \u0443\u0447\u0440\u0435\u0436\u0434\u0435\u043d\u0438\u0438 \u0430\u043b\u044c\u0442\u0435\u0440\u043d\u0430\u0442\u0438\u0432\u043d\u043e\u0433\u043e \u0447\u0435\u043c\u043f\u0438\u043e\u043d\u0430\u0442\u0430 \u043c\u0438\u0440\u0430 \u0432 \u043a\u043b\u0430\u0441\u0441\u0435 \u00ab\u0424\u043e\u0440\u043c\u0443\u043b\u0430-1\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/2003_%D0%B3%D0%BE%D0%B4\" title=\"2003 \u0433\u043e\u0434\">2003<\/a>&#160;\u2014 \u043e\u0434\u043d\u043e \u0438\u0437 \u0441\u0430\u043c\u044b\u0445 \u0441\u043a\u0430\u043d\u0434\u0430\u043b\u044c\u043d\u044b\u0445 \u0432 \u0421\u041d\u0413 \u043f\u0440\u0435\u0434\u0441\u0442\u0430\u0432\u043b\u0435\u043d\u0438\u0439 \u0434\u043b\u044f \u043c\u043e\u043b\u043e\u0434\u0451\u0436\u0438&#160;\u2014 \u0444\u0435\u0441\u0442\u0438\u0432\u0430\u043b\u044c \u0441\u043e\u0432\u0440\u0435\u043c\u0435\u043d\u043d\u043e\u0439 \u043c\u0443\u0437\u044b\u043a\u0438 \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B5%D1%81%D0%BF%D1%83%D0%B1%D0%BB%D0%B8%D0%BA%D0%B0_%D0%9A%D0%B0%D0%B7%D0%B0%D0%BD%D1%82%D0%B8%D0%BF\" class=\"mw-redirect\" title=\"\u0420\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0430 \u041a\u0430\u0437\u0430\u043d\u0442\u0438\u043f\">\u041a\u0430\u0437\u0430\u043d\u0442\u0438\u043f<\/a>\u00bb, \u0435\u0436\u0435\u0433\u043e\u0434\u043d\u043e \u043f\u0440\u043e\u0432\u043e\u0434\u0438\u0432\u0448\u0438\u0439\u0441\u044f \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D1%80%D1%8B%D0%BC\" title=\"\u041a\u0440\u044b\u043c\">\u041a\u0440\u044b\u043c\u0443<\/a>, \u043e\u0431\u044a\u044f\u0432\u043b\u0435\u043d \u0432 \u0430\u0432\u0442\u043e\u043d\u043e\u043c\u043d\u043e\u0439 \u0440\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0435 \u00ab\u043f\u0435\u0440\u0441\u043e\u043d\u043e\u0439 \u043d\u043e\u043d \u0433\u0440\u0430\u0442\u0430\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/2004_%D0%B3%D0%BE%D0%B4\" title=\"2004 \u0433\u043e\u0434\">2004<\/a><ul><li>\u0414\u0435\u043f\u0443\u0442\u0430\u0442\u044b \u043f\u0430\u0440\u043b\u0430\u043c\u0435\u043d\u0442\u0430 \u0413\u0440\u0443\u0437\u0438\u0438 \u043d\u0430 \u043f\u043b\u0435\u043d\u0430\u0440\u043d\u043e\u043c \u0437\u0430\u0441\u0435\u0434\u0430\u043d\u0438\u0438 21 \u043c\u0430\u044f \u0432\u043e \u0432\u0442\u043e\u0440\u043e\u043c \u0438 \u0442\u0440\u0435\u0442\u044c\u0435\u043c \u0441\u043b\u0443\u0448\u0430\u043d\u0438\u0438 \u0443\u0442\u0432\u0435\u0440\u0434\u0438\u043b\u0438 \u0437\u0430\u043a\u043e\u043d\u043e\u043f\u0440\u043e\u0435\u043a\u0442 \u00ab\u041e \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u043c \u0433\u0438\u043c\u043d\u0435\u00bb, \u043f\u0440\u0435\u0434\u043b\u043e\u0436\u0435\u043d\u043d\u044b\u0439 \u043f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442\u043e\u043c \u0413\u0440\u0443\u0437\u0438\u0438. \u041c\u0443\u0437\u044b\u043a\u0430 \u0433\u0438\u043c\u043d\u0430 \u044f\u0432\u043b\u044f\u0435\u0442\u0441\u044f \u043e\u0431\u0440\u0430\u0431\u043e\u0442\u043a\u043e\u0439 \u043a\u043e\u043c\u043f\u043e\u0437\u0438\u0442\u043e\u0440\u0430 \u0418\u043e\u0441\u0438\u0444\u0430 \u041a\u0435\u0447\u0430\u043a\u043c\u0430\u0434\u0437\u0435 \u043c\u043e\u0442\u0438\u0432\u043e\u0432 \u0438\u0437 \u043e\u043f\u0435\u0440 \u00ab\u0410\u0431\u0435\u0441\u0441\u0430\u043b\u043e\u043c \u0438 \u042d\u0442\u0435\u0440\u0438\u00bb \u0438 \u00ab\u0414\u0430\u0438\u0441\u0438\u00bb \u0433\u0440\u0443\u0437\u0438\u043d\u0441\u043a\u043e\u0433\u043e \u043a\u043e\u043c\u043f\u043e\u0437\u0438\u0442\u043e\u0440\u0430-\u043a\u043b\u0430\u0441\u0441\u0438\u043a\u0430 \u0417\u0430\u043a\u0430\u0440\u0438\u044f \u041f\u0430\u043b\u0438\u0430\u0448\u0432\u0438\u043b\u0438. \u0410\u0432\u0442\u043e\u0440\u043e\u043c \u0442\u0435\u043a\u0441\u0442\u0430 \u0433\u0438\u043c\u043d\u0430 \u044f\u0432\u043b\u044f\u0435\u0442\u0441\u044f \u0441\u043e\u0432\u0440\u0435\u043c\u0435\u043d\u043d\u044b\u0439 \u0433\u0440\u0443\u0437\u0438\u043d\u0441\u043a\u0438\u0439 \u043f\u043e\u044d\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D0%B3%D1%80%D0%B0%D0%B4%D0%B7%D0%B5,_%D0%94%D0%B0%D0%B2%D0%B8%D0%B4_%D0%AD%D0%BB%D0%B3%D1%83%D0%B4%D0%B6%D0%B0%D0%B5%D0%B2%D0%B8%D1%87\" title=\"\u041c\u0430\u0433\u0440\u0430\u0434\u0437\u0435, \u0414\u0430\u0432\u0438\u0434 \u042d\u043b\u0433\u0443\u0434\u0436\u0430\u0435\u0432\u0438\u0447\">\u0414\u0430\u0432\u0438\u0434 \u041c\u0430\u0433\u0440\u0430\u0434\u0437\u0435<\/a>.<\/li><li>\u041f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D1%83%D1%80%D1%86%D0%B8%D1%8F\" title=\"\u0422\u0443\u0440\u0446\u0438\u044f\">\u0422\u0443\u0440\u0446\u0438\u0438<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B5%D0%B7%D0%B5%D1%80,_%D0%90%D1%85%D0%BC%D0%B5%D1%82_%D0%9D%D0%B5%D0%B4%D0%B6%D0%B4%D0%B5%D1%82\" title=\"\u0421\u0435\u0437\u0435\u0440, \u0410\u0445\u043c\u0435\u0442 \u041d\u0435\u0434\u0436\u0434\u0435\u0442\">\u0410\u0445\u043c\u0435\u0442 \u041d\u0435\u0434\u0436\u0434\u0435\u0442 \u0421\u0435\u0437\u0435\u0440<\/a> \u043f\u043e\u0434\u043f\u0438\u0441\u0430\u043b \u043f\u0430\u043a\u0435\u0442 \u0437\u0430\u043a\u043e\u043d\u043e\u0432 \u043e \u0432\u043d\u0435\u0441\u0435\u043d\u0438\u0438 \u043f\u043e\u043f\u0440\u0430\u0432\u043e\u043a \u0432 \u043a\u043e\u043d\u0441\u0442\u0438\u0442\u0443\u0446\u0438\u044e \u0441\u0442\u0440\u0430\u043d\u044b, \u043d\u0435\u043e\u0431\u0445\u043e\u0434\u0438\u043c\u044b\u0445 \u0434\u043b\u044f \u0432\u0441\u0442\u0443\u043f\u043b\u0435\u043d\u0438\u044f \u0422\u0443\u0440\u0446\u0438\u0438 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%95%D0%B2%D1%80%D0%BE%D0%BF%D0%B5%D0%B9%D1%81%D0%BA%D0%B8%D0%B9_%D1%81%D0%BE%D1%8E%D0%B7\" title=\"\u0415\u0432\u0440\u043e\u043f\u0435\u0439\u0441\u043a\u0438\u0439 \u0441\u043e\u044e\u0437\">\u0415\u0432\u0440\u043e\u0441\u043e\u044e\u0437<\/a>.<\/li><li>\u0412 \u041c\u043e\u0441\u043a\u0432\u0435 \u043d\u0430 \u0412\u0430\u0441\u0438\u043b\u044c\u0435\u0432\u0441\u043a\u043e\u043c \u0441\u043f\u0443\u0441\u043a\u0435 \u043e\u0442\u043a\u0440\u044b\u043b\u0441\u044f 2-\u0439 \u0412\u0441\u0435\u043c\u0438\u0440\u043d\u044b\u0439 \u0444\u0435\u0441\u0442\u0438\u0432\u0430\u043b\u044c \u0447\u0430\u044f.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/2006_%D0%B3%D0%BE%D0%B4\" title=\"2006 \u0433\u043e\u0434\">2006<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A7%D0%B5%D1%80%D0%BD%D0%BE%D0%B3%D0%BE%D1%80%D0%B8%D1%8F\" title=\"\u0427\u0435\u0440\u043d\u043e\u0433\u043e\u0440\u0438\u044f\">\u0427\u0435\u0440\u043d\u043e\u0433\u043e\u0440\u0438\u0438<\/a> \u0441\u043e\u0441\u0442\u043e\u044f\u043b\u0441\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B5%D1%84%D0%B5%D1%80%D0%B5%D0%BD%D0%B4%D1%83%D0%BC_%D0%BE_%D0%BD%D0%B5%D0%B7%D0%B0%D0%B2%D0%B8%D1%81%D0%B8%D0%BC%D0%BE%D1%81%D1%82%D0%B8_%D0%A7%D0%B5%D1%80%D0%BD%D0%BE%D0%B3%D0%BE%D1%80%D0%B8%D0%B8_(2006)\" title=\"\u0420\u0435\u0444\u0435\u0440\u0435\u043d\u0434\u0443\u043c \u043e \u043d\u0435\u0437\u0430\u0432\u0438\u0441\u0438\u043c\u043e\u0441\u0442\u0438 \u0427\u0435\u0440\u043d\u043e\u0433\u043e\u0440\u0438\u0438 (2006)\">\u0440\u0435\u0444\u0435\u0440\u0435\u043d\u0434\u0443\u043c \u043e \u043d\u0435\u0437\u0430\u0432\u0438\u0441\u0438\u043c\u043e\u0441\u0442\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/2007_%D0%B3%D0%BE%D0%B4\" title=\"2007 \u0433\u043e\u0434\">2007<\/a>&#160;\u2014 \u043d\u0430 \u0432\u0441\u0435\u043c\u0438\u0440\u043d\u043e \u0438\u0437\u0432\u0435\u0441\u0442\u043d\u043e\u043c \u043a\u043b\u0438\u043f\u0435\u0440\u0435 \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D1%82%D1%82%D0%B8_%D0%A1%D0%B0%D1%80%D0%BA\" title=\"\u041a\u0430\u0442\u0442\u0438 \u0421\u0430\u0440\u043a\">\u041a\u0430\u0442\u0442\u0438 \u0421\u0430\u0440\u043a<\/a>\u00bb \u043f\u0440\u043e\u0438\u0437\u043e\u0448\u0451\u043b \u043f\u043e\u0436\u0430\u0440, \u0441\u0435\u0440\u044c\u0451\u0437\u043d\u043e \u043f\u043e\u0432\u0440\u0435\u0434\u0438\u0432\u0448\u0438\u0439 \u043a\u043e\u0440\u0430\u0431\u043b\u044c.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/2008_%D0%B3%D0%BE%D0%B4\" title=\"2008 \u0433\u043e\u0434\">2008<\/a><ul><li>\u00ab<a href=\"https:\/\/ru.wikipedia.org\/w\/index.php?title=%D0%9F%D0%B0%D0%BD%D0%B8%D0%BA%D0%B0_21_%D0%BC%D0%B0%D1%8F_2008_%D0%B3%D0%BE%D0%B4%D0%B0_%D0%B2_%D0%A1%D0%B0%D0%BD%D0%BA%D1%82-%D0%9F%D0%B5%D1%82%D0%B5%D1%80%D0%B1%D1%83%D1%80%D0%B3%D0%B5&amp;action=edit&amp;redlink=1\" class=\"new\" title=\"\u041f\u0430\u043d\u0438\u043a\u0430 21 \u043c\u0430\u044f 2008 \u0433\u043e\u0434\u0430 \u0432 \u0421\u0430\u043d\u043a\u0442-\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\u0435 (\u0441\u0442\u0440\u0430\u043d\u0438\u0446\u0430 \u043e\u0442\u0441\u0443\u0442\u0441\u0442\u0432\u0443\u0435\u0442)\">\u0414\u0435\u043d\u044c \u0439\u043e\u0434\u0430<\/a>\u00bb \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D0%BD%D0%BA%D1%82-%D0%9F%D0%B5%D1%82%D0%B5%D1%80%D0%B1%D1%83%D1%80%D0%B3\" title=\"\u0421\u0430\u043d\u043a\u0442-\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\">\u0421\u0430\u043d\u043a\u0442-\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\u0435<\/a>: \u043f\u043e \u0433\u043e\u0440\u043e\u0434\u0443 \u043f\u0440\u043e\u043a\u0430\u0442\u044b\u0432\u0430\u0435\u0442\u0441\u044f \u0432\u043e\u043b\u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BB%D1%83%D1%85_(%D0%B8%D0%BD%D1%84%D0%BE%D1%80%D0%BC%D0%B0%D1%86%D0%B8%D1%8F)\" title=\"\u0421\u043b\u0443\u0445 (\u0438\u043d\u0444\u043e\u0440\u043c\u0430\u0446\u0438\u044f)\">\u0441\u043b\u0443\u0445\u043e\u0432<\/a> \u043e \u044f\u043a\u043e\u0431\u044b \u043f\u0440\u043e\u0438\u0437\u043e\u0448\u0435\u0434\u0448\u0435\u043c \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B5%D0%BD%D0%B8%D0%BD%D0%B3%D1%80%D0%B0%D0%B4%D1%81%D0%BA%D0%B0%D1%8F_%D0%90%D0%AD%D0%A1\" title=\"\u041b\u0435\u043d\u0438\u043d\u0433\u0440\u0430\u0434\u0441\u043a\u0430\u044f \u0410\u042d\u0421\">\u041b\u0435\u043d\u0438\u043d\u0433\u0440\u0430\u0434\u0441\u043a\u043e\u0439 \u0410\u042d\u0421<\/a> \u0432\u044b\u0431\u0440\u043e\u0441\u0435 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D1%82%D0%BC%D0%BE%D1%81%D1%84%D0%B5%D1%80%D0%B0\" title=\"\u0410\u0442\u043c\u043e\u0441\u0444\u0435\u0440\u0430\">\u0430\u0442\u043c\u043e\u0441\u0444\u0435\u0440\u0443<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B0%D0%B4%D0%B8%D0%BE%D0%B0%D0%BA%D1%82%D0%B8%D0%B2%D0%BD%D1%8B%D0%B9_%D1%80%D0%B0%D1%81%D0%BF%D0%B0%D0%B4\" title=\"\u0420\u0430\u0434\u0438\u043e\u0430\u043a\u0442\u0438\u0432\u043d\u044b\u0439 \u0440\u0430\u0441\u043f\u0430\u0434\">\u0440\u0430\u0434\u0438\u043e\u0430\u043a\u0442\u0438\u0432\u043d\u044b\u0445<\/a> \u0432\u0435\u0449\u0435\u0441\u0442\u0432. \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BF%D1%82%D0%B5%D0%BA%D0%B0\" title=\"\u0410\u043f\u0442\u0435\u043a\u0430\">\u0430\u043f\u0442\u0435\u043a\u0430\u0445<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D0%BD%D0%BA%D1%82-%D0%9F%D0%B5%D1%82%D0%B5%D1%80%D0%B1%D1%83%D1%80%D0%B3\" title=\"\u0421\u0430\u043d\u043a\u0442-\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\">\u0421\u0430\u043d\u043a\u0442-\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\u0430<\/a> \u0440\u0430\u0441\u043a\u0443\u043f\u043b\u0435\u043d \u0432\u0435\u0441\u044c \u0437\u0430\u043f\u0430\u0441 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D0%BE%D0%B4\" title=\"\u0418\u043e\u0434\">\u0439\u043e\u0434\u043e\u0441\u043e\u0434\u0435\u0440\u0436\u0430\u0449\u0438\u0445<\/a> \u043f\u0440\u0435\u043f\u0430\u0440\u0430\u0442\u043e\u0432.<\/li><\/ul><\/li><\/ul><h2>"}